import React from 'react';
import './App.css';

class App extends React.Component{

render(){
  const Users = () => {
    var users = [
      { name: 'Robin', isDeveloper: true },
      { name: 'Markus', isDeveloper: false },
      { name: 'codewar', isDeveloper: true }
    ];
    return (
      <ul>
        {users
          .filter(user => user.isDeveloper)
          .map(user => <li>{user.name}</li>)
        }
      </ul>
    );
  };
}

}

export default App;
